 po postupku)<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\nAko ste primetili neke probleme u bilo kom od ovih koraka, uklju\\u010dite <strong>Log de\\u0161avanja<\\/strong> i pogledajte <strong>Re\\u0161avanje problema<\\/strong>\"],[\"Promote your affiliate program\",\"Promovi\\u0161ite va\\u0161 partnerski program\"],[\"GetStartedPromote\",\"Po\\u0161to ste uspe\\u0161no testirali integraciju partnerskog sistema sa va\\u0161im sajtom, sve je spremno da po\\u010dnete sa promocijom va\\u0161eg novog partnerskog programa tako \\u0161to \\u0107ete privu\\u0107i nove partnere da se registruju.<br\\/><br\\/>\\r\\nMorate ubaciti link ka partnerskom programu - mini sajtu ili registraciji na va\\u0161 sajt. Nazovite link Partnerski program, Ili Webmasteri zaradite novac, Afiliejt ... Ovo \\u0107e privu\\u0107i posetioce va\\u0161eg sajta i preobratiti ih u va\\u0161e partnere.<br\\/><br\\/>\\r\\nZa dobijanje vi\\u0161e potencijalnih partnera, dodajte va\\u0161 program u razne direktorijume top liste pretra\\u017eiva\\u010de i sli\\u010dno. \"],[\"Ad Channels\",\"Dodajte kanale\"],[\"Advanced tools\",\"Napredni alati\"],[\"Subaffiliate Sale Stats\",\"Statistika prodaje pod-partnera\"],[\"ContactUs\",\"KontaktirajteNas\"],[\"Promotion tips\",\"Promocija saveti\"],[\"Frequently asked questions\",\"\\u010cesto postavljana pitanja\"],[\"Advanced tracking\",\"Napredno pra\\u0107enje\"],[\"DirectLinks explained\",\"Direktni Lonkovi Obja\\u0161njenje\"],[\"Sale counts\",\"Broj prodaja\"],[\"CTR (raw \\/ unique)\",\"CTR (svi \\/ jedinstveni)\"],[\"Design & Contents settings\",\"Pode\\u0161avanje dizajna i sadr\\u017eaja\"],[\"Payee info\",\"Informacije primaoca\"],[\"Copy & Paste the text above to your email editor\",\"Iskopirajte ovaj tekst u va\\u0161 email editor\"],[\"Show TEXT version\",\"Prika\\u017eite TEKST verziju\"],[\"Checking for new version...\",\"Proveravam da li postoji nova verzija...\"],[\"You are running latest version.\",\"Koristite poslednju verziju\"],[\"Latest version %s is